So I just got voted out. It’s a heavy feeling because I wanted to win and prove myself. But I’m grateful that roadies happened to me. I will not let this failure get to my heart because those 31 days will always stay with me and I’ll cherish them forever. It was a very short journey for me because I came late and already priorities were made but it was a memorable one. I met some amazing human beings there, so talented and hard working. Every one there had a different journey with the aspiration of the writing their own stories which would be engraved and remembered. I’m glad we all met and shared a surreal experience. The best part was no matter how many times we fought we used to eat together, jam together, work out together. Kafi khubsurat log the aur kafi khubsurat yaadein. 
Thanks @mtvroadies for giving me this chance. And thank you for believing in me. 
